import React from "react";

function AboutCard({heading, desc, svg}) {
  return (
    <div className="about-card">
      <img src={svg} />
      <div className="about-card--top">{heading}</div>
      <h2>{desc}</h2>
    </div>
  );
}

export default AboutCard;
